import {Table } from 'antd';
import React from 'react';
const columns = [
  {
    title: 'First Name',
    dataIndex: 'firstName',
    key: 'firstName',
    render: (text) => <a>{text}</a>,
  },
  {
    title: 'Last Name',
    dataIndex: 'lastName',
    key: 'lastName',
  },
  {
    title: 'Phone Number',
    dataIndex: 'phoneNumber',
    key: 'phoneNumber',
  },
  {
    title: 'Action',
    key: 'action',
    render: () => (
        <>
        <a>Edit</a>
        <br />
        <a>Delete</a>
        </>
    ),
  },
];
const data = [
  {
    key: '1',
    firstName: 'John Brown',
    lastName: 'John Brown',
    phoneNumber: 123,
  },
  {
    key: '2',
    firstName: 'Jim Green',
    lastName: 'Jim Green',
    phoneNumber: 123,
  },
  {
    key: '3',
    firstName: 'Joe Black',
    lastName: 'SOOOO',
    phoneNumber: 123,
  },
];

const Tabel = () => <Table columns={columns} dataSource={data} />;

export default Tabel;
